<h1 id="cja-apis-calculated-metrics-api">Calculated Metrics API</h1>

## findOneCalculatedMetric_1

<a id="opIdfindOneCalculatedMetric_1"></a>

`GET /calculatedmetrics/{id}`

*Retrieve a single calculated metric by id*

A calculated metric response will always include these default items: *id, name, description, rsid, owner, polarity, precision, type* 

Other attributes can be optionally requested through the 'expansion' field:

* *modified*: Date that the metric was last modified (ISO 8601)
* *definition*: Calculated metric definition as JSON object
* *compatibility*: Products that the metric is compatible with
* *reportSuiteName*: Also return the friendly Report Suite name for the RSID
* *tags*: Gives all existing tags associated with the calculated metric

For more information about calculated metrics go [here](https://github.com/AdobeDocs/analytics-2.0-apis/blob/master/calculatedmetrics.md)

<h3 id="findonecalculatedmetric_1-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|id|path|string|true|The calculated metric ID to retrieve|
|expansion|query|array[string]|false|Comma-delimited list of additional calculated metric metadata fields to include on response.|
|includeHidden|query|boolean|false|Whether to include variables that are hidden in the UI or that the user doesn't have permission to.|
|toBeUsedInRsid|query|string|false|The report suite where the calculated metric is intended to be used. This report suite will be used to determine things like compatibility and permissions.  If it is not specified then the permissions will be calculated based on the union of all metrics authorized in all groups the user belongs to.  If the compatibility expansion is specified and toBeUsedInRsid is not then the compatibility returned is based off the compatibility from the last time the calculated metric was saved.|
|locale|query|string|false|Locale|

